module.exports = {"type":"root","children":[{"type":"yaml","value":"title: Hrmph\nslug: another-week-down-the-drain\ndate: March 20, 2017","position":{"start":{"line":1,"column":1,"offset":0},"end":{"line":5,"column":4,"offset":75},"indent":[1,1,1,1]}},{"type":"paragraph","children":[{"type":"text","value":"Why is this centered?","position":{"start":{"line":7,"column":1,"offset":77},"end":{"line":7,"column":22,"offset":98},"indent":[]}}],"position":{"start":{"line":7,"column":1,"offset":77},"end":{"line":7,"column":22,"offset":98},"indent":[]}},{"type":"paragraph","children":[{"type":"text","value":"It shouldn't be centered.","position":{"start":{"line":9,"column":1,"offset":100},"end":{"line":9,"column":26,"offset":125},"indent":[]}}],"position":{"start":{"line":9,"column":1,"offset":100},"end":{"line":9,"column":26,"offset":125},"indent":[]}},{"type":"paragraph","children":[{"type":"text","value":"Oh it isn't actually centered. It is in a containing element that is centered, whose width is not predefined.","position":{"start":{"line":11,"column":1,"offset":127},"end":{"line":11,"column":110,"offset":236},"indent":[]}}],"position":{"start":{"line":11,"column":1,"offset":127},"end":{"line":11,"column":110,"offset":236},"indent":[]}},{"type":"paragraph","children":[{"type":"inlineCode","value":"document.designMode","position":{"start":{"line":13,"column":1,"offset":238},"end":{"line":13,"column":22,"offset":259},"indent":[]}},{"type":"text","value":" was on, so you can go ahead and delete everything except the first couple paragraphs and see what I was referring to.\nI am fed up with how hard I have been working on this project for work. Two Fridays ago, I semi-quit my job. I offered to stay on and finish the project I was working on, up through a certain predefined scope, since I didn't want to leave the company hanging too bad, but I wasn't expecting to have to work on it as much as I have been. I don't know why I feel like I need to vent though. It is definitely getting better. I have just about written enough abstract classes that the future work on the project should be relatively smooth.","position":{"start":{"line":13,"column":22,"offset":259},"end":{"line":14,"column":537,"offset":914},"indent":[1]}}],"position":{"start":{"line":13,"column":1,"offset":238},"end":{"line":14,"column":537,"offset":914},"indent":[1]}},{"type":"paragraph","children":[{"type":"text","value":"For my company, this project has been a nightmare. They started working on it somewhere between 2 and 4 years ago, and it has just gone on and on. I came in about 9 months ago, worked on it underneath another developer and handled a specific component, without looking at the general architecture really at all. (I was very junior at the time.) I could tell that the codebase was out of control, and I urged the lead developer to take a second and refactor some things to make our lives easier, but she never felt like putting in the small amount of time that would save us days or weeks down the road.","position":{"start":{"line":16,"column":1,"offset":916},"end":{"line":16,"column":603,"offset":1518},"indent":[]}}],"position":{"start":{"line":16,"column":1,"offset":916},"end":{"line":16,"column":603,"offset":1518},"indent":[]}},{"type":"paragraph","children":[{"type":"text","value":"We stopped working on the project after a \"BETA\" release to our client in September. The lead developer quit some time in August. During her last couple weeks, I asked her a number of times if she could write some basic documentation that just generalizes the approach and design of the project, and she kept saying oh yeah yeah I will. She was totally checked out and never did.\nAt the same time, my boss, our company's lead developer and tech director was also checked out. He was thinking about leaving/moving away and finding somewhere else to work. There's some amount of blame to be put on him for never reviewing the project lead's code. He knew someone should be making sure things are being done in a reasonable way, and he just didn't care. Now, months later, I am in charge of the project, and the only person who is paying for the debt brought about is me. That is not right, and I don't know what else can be done. Is it not rude and irresponsible of my predecessors to leave a project in such disarray?","position":{"start":{"line":18,"column":1,"offset":1520},"end":{"line":19,"column":637,"offset":2536},"indent":[1]}}],"position":{"start":{"line":18,"column":1,"offset":1520},"end":{"line":19,"column":637,"offset":2536},"indent":[1]}},{"type":"paragraph","children":[{"type":"text","value":"What complicates the matter even more is that the people at my company who I now am reporting to don't have a clue what the difference between HTML, CSS, and JavaScript are. They don't know what a canvas element is. The should know more if they want to be successful in the industry we are in. It can't all come down to me. I, of course, take pride in my work, and am not willing to produce poor quality work because others' around me, but I can't put all my time into fixing other people's mistakes, laziness, and just general shitty work. It has been very frustrating. Hrmph.","position":{"start":{"line":21,"column":1,"offset":2538},"end":{"line":21,"column":578,"offset":3115},"indent":[]}}],"position":{"start":{"line":21,"column":1,"offset":2538},"end":{"line":21,"column":578,"offset":3115},"indent":[]}}],"position":{"start":{"line":1,"column":1,"offset":0},"end":{"line":21,"column":578,"offset":3115}}}

